CREATE TABLE encu.ocupacion
(
  ocu_ocu integer NOT NULL,
  ocu_descripcion character varying(200),
  ocu_tlg bigint,
  CONSTRAINT ocupacion_pk PRIMARY KEY (ocu_ocu),
  CONSTRAINT "texto de descripción de ocupacion inválido" CHECK (comun.cadena_valida(ocu_descripcion, 'castellano'))
);

